import React, { useEffect, useState } from 'react';
import FetchEventsTurku from '../api/FetchEventsTurku';



export default function ListImages() {
  const [myEvents, setAllEvents] = useState<any>("")

  const allEvents = async (page: number) => {

    const res: any = await FetchEventsTurku(page);
    console.log(res.status);
    console.log(res.data);
    console.log(res.data.data);
    setAllEvents(res.data.data);
  }

  useEffect(() => {
    allEvents(1);
  }, [])

  return (
    // <h1>Events TURKU</h1>
    <>
      {myEvents &&
        myEvents.map((event: any, i: number) =>
          (<div key={i} className="col-lg-4 col-md-6">
            {/* <div className="d-flex flex-column flex-md-row">
              <div className="card custom-card mb-3" style={{ borderRadius: '9px' }}>
                <div className="card-cover rounded-top" style={{ backgroundImage: `url(${"https://picsum.photos/600/400/?random"})` }}>
                  <div className="circle-image" style={{ backgroundImage: `url(${"https://picsum.photos/200/110/?random"})` }}></div>
                </div>
                <div className="card-body">
                  <h5 className="card-title">Card title</h5>
                  <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                </div>
              </div>
            </div> */}
            <div className="card clearfix">
              <img className="card-img-top img-fluid" src="https://picsum.photos/600/400/?random" alt="" />
              <div className="card-block">
                <h4 className="card-title">
                  Product title</h4>
                <div className="row">
                  <div className="col-xs-6">
                    <p>
                      £21.000</p>
                  </div>
                  <div className="col-xs-6 text-xs-right">
                    <p>
                      03/03/2016</p>
                  </div>
                </div>
              </div>
            </div>
            {/* <div className="card card-chart">
              <span className="card-header " style={{ height: '130px' }}>
                {event.images.length > 0 ? <img style={{ height: '90px' }} src={event.images[0].url} alt="event" /> : <img style={{ height: '90px' }} src='/images/logo.png' alt="no image" />}
                {event.id}
                {event.end_time}
                {event.name ? event.name.fi : 'no name'}
                {event.description ? event.description.fi : ''}
              </span>
            </div> */}
          </div>)
        )
      }
    </>
  )
}


